const burgerButton = document.getElementById("icon_side-bar_main");
const burgerMenu = document.getElementById("sidebar_list_main");

burgerButton.addEventListener("click", () => {
  burgerMenu.style.display = burgerMenu.style.display === "block" ? "none" : "block";
});

burgerButton.addEventListener("click", () => {
    console.log("Success")
  });
